import React, { useState } from 'react';
import axios from 'axios';

const PaymentForm = () => {
  const [formData, setFormData] = useState({
    amount: '',
    currency: 'TNR',
    bookingId: '',
    flightId: '',
    method: 'RAZORPAY'
  });

  const [orderId, setOrderId] = useState('');
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

    try {
      const response = await axios.post('http://localhost:8080/payment/booking', formData, {
        headers: {
          'Authorization': 'Bearer eyJraWQI/Oli2YT\\2xNjRtOt',
          'Content-Type': 'application/json'
        }
      });

      // Assuming the response contains the orderId
      setOrderId(response.data.orderId || 'Order created successfully');
      alert('Payment order created successfully!');
    } catch (error) {
      console.error('Error creating payment order:', error);
      alert('Failed to create payment order. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="payment-form-container">
      <h2>Create Payment Order</h2>
      <form onSubmit={handleSubmit} className="payment-form">
        <div className="form-group">
          <label htmlFor="amount">Amount:</label>
          <input
            type="number"
            id="amount"
            name="amount"
            value={formData.amount}
            onChange={handleChange}
            required
            placeholder="Enter amount"
          />
        </div>

        <div className="form-group">
          <label htmlFor="currency">Currency:</label>
          <select
            id="currency"
            name="currency"
            value={formData.currency}
            onChange={handleChange}
            required
          >
            <option value="TNR">TNR</option>
            <option value="INR">INR</option>
            <option value="USD">USD</option>
          </select>
        </div>

        <div className="form-group">
          <label htmlFor="bookingId">Booking ID:</label>
          <input
            type="number"
            id="bookingId"
            name="bookingId"
            value={formData.bookingId}
            onChange={handleChange}
            required
            placeholder="Enter booking ID"
          />
        </div>

        <div className="form-group">
          <label htmlFor="flightId">Flight ID:</label>
          <input
            type="number"
            id="flightId"
            name="flightId"
            value={formData.flightId}
            onChange={handleChange}
            required
            placeholder="Enter flight ID"
          />
        </div>

        <div className="form-group">
          <label htmlFor="method">Payment Method:</label>
          <select
            id="method"
            name="method"
            value={formData.method}
            onChange={handleChange}
            required
          >
            <option value="RAZORPAY">Razorpay</option>
            <option value="PAYPAL">PayPal</option>
            <option value="STRIPE">Stripe</option>
          </select>
        </div>

        <button type="submit" disabled={loading} className="submit-button">
          {loading ? 'Creating Order...' : 'Create Payment Order'}
        </button>
      </form>

      {orderId && (
        <div className="order-result">
          <h3>Order Created Successfully!</h3>
          <p><strong>Order ID:</strong> {orderId}</p>
        </div>
      )}
    </div>
  );
};

export default PaymentForm;
